-- ----------------------------
-- Table structure for t_sys_dict
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_dict`;
CREATE TABLE `t_sys_dict` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '字典主键（自增ID）',
  `code` varchar(20) NOT NULL COMMENT '字典编码',
  `parent_code` varchar(20) DEFAULT NULL COMMENT '上级字典编码',
  `name` varchar(20) NOT NULL COMMENT '字典名称',
  `value` varchar(20) DEFAULT NULL COMMENT '字典值',
  `type` tinyint(1) NOT NULL COMMENT '字典类型',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认（0、不是，1、是）',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `sort` tinyint(1) NOT NULL DEFAULT '1' COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态(0=无效,1=有效)',
  `opt_id` varchar(20) NOT NULL COMMENT '操作人id',
  `opt_name` varchar(20) NOT NULL COMMENT '操作人名称(冗余)',
  `opt_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '操作时间(YYYY-MM-DD HH:MM:SS)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `dict_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8 COMMENT='字典表';

